import React from 'react';

const LoginForm = () => {
    return (
        <>
            <div className="LoginForm">
                <input type="text"/>
                <input typ="text"/>
            </div>
            <style global jsx>
                {`
                    .LoginForm {
                        width: 400px;
                        height: 600px;
                        margin: 0 auto;
                        top: 50%;
                        margin-top: 250px;
                    }
                `}
            </style>
        </>
    )
}

export default LoginForm;
